// constant
const icons = {
    IconDashboard,
    IconDeviceAnalytics,
    IconTag
};

// ==============================|| DASHBOARD MENU ITEMS ||============================== //

const configuracion = {
    id: 'configuracion',
    title: <FormattedMessage id="ConfiguraciÃ³n" />,
    type: 'group',
    children: [
        {
            id: 'perfil',
